module("SetUuidCommand"),test("Test SetUuidCommand (Undo and Redo)",function(){var t=new Editor,e=aBox("UUID test box");t.execute(new AddObjectCommand(e));var a=[THREE.Math.generateUUID(),THREE.Math.generateUUID(),THREE.Math.generateUUID()];a.map(function(a){var n=new SetUuidCommand(e,a);n.updatable=!1,t.execute(n)}),ok(e.uuid==a[a.length-1],"OK, UUID on actual object matches last UUID in the test data array "),t.undo(),ok(e.uuid==a[a.length-2],"OK, UUID on actual object matches second to the last UUID in the test data array (after undo)"),t.redo(),ok(e.uuid==a[a.length-1],"OK, UUID on actual object matches last UUID in the test data array again (after redo) ")});